import web from "../src/images/web.png";
import app from "../src/images/app.png";
import android from "../src/images/and.png";
import digital from "../src/images/dig.png";
import marketing from "../src/images/mark.png";
import software from "../src/images/soft.png";

const Sdata = [
  {
    imgsrc: web,
    title: "web development",
    desc:"Web development is the work involved in developing a Web site for the Internet. ",
  },
  {
    imgsrc: app,
    title: "App development",
    desc:" Mobile application development arena being one of the most innovative spaces.",
  },
  {
    imgsrc: software,
    title: "Software development",
    desc:"Standalone or individual software is created using a specific programming language.",
  },
  {
    imgsrc: digital,
    title: "Digital Marketing",
  },
  {
    imgsrc: android,
    title: "Android development",
  },
  {
    imgsrc: marketing,
    title: "Marketing",
  },
];

export default Sdata;
